import React, { Component } from "react";
import { Line, Circle } from "rc-progress";

const StepThree = (props) => {

  return(
    <div class="logcardback2">
    <div className="sign-text">ALMOST DONE!</div>
    <div class="prog">
      <Line
        percent="100"
        strokeWidth="2"
        strokeColor="#B74852"
        trailWidth="1"
        trailColor="white"
      />
    </div>
    <div>
      <img class="verify" src="/images/verify.svg" alt="" />
    </div>
    <div>
      <a href="#" class="button" role="button" onClick = {async function onRegister() {
		try {
			await firebase.register(props.name, props.email, props.password)
			// await firebase.addQuote(quote)
			// props.history.replace('/dashboard')
		} catch(error) {
			alert(error.message)
		}
	}}>
        Lets Go!
      </a>
    </div>
  </div>


  );
}

 

export default StepThree;
